// This data contains a list of all projects data added to the Projects section on the website 
    const data = [
    {
        id: 1,
        img: "/assets/wc.png",
        year: "May 2021",
        title: "FINAL YEAR THESIS",
        desc: " illum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia.",
        git :"https://github.com/willianck/Thesis",
        skills: 'Python',
        skills1: "FlairNLP",
        style: {
            "transitionDelay": "300ms"
        }
    },

    {
        id: 2,
        img: "/assets/farm.png",
        year: "May 2021",
        title:"PREDICTING FOOD INSECURITY",
        desc: "fweggghr  sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:'https://github.com/willianck/ADS',
        skills: 'Python',
        skills1: "FlairNLP",
        featured: true,
        style: {
            "transitionDelay": "500ms"
        }


    },

    {
        id: 3,
        img: "/assets/sceemspace.jpg",
        year:"May 2020",
        title: "SCEEM SPACE",
        desc:"  eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.",
        git:"https://github.com/willianck/SCEEMSPACE",
        skills: 'Python',
        skills1: "FlairNLP",
        style: {
            "transitionDelay": "100ms"
        }
    }
]




    return (
        <div className = "projects" id = 'projects'>
            <FadeInSection>
            <h1><i class="fas fa-code"></i> Projects</h1>
            </FadeInSection>
            <div className='container'>
                <ul className='items-grid'>
                  {data.map((d)=>(

                <FadeInSection style={d.style}>
                <li className ="items">
                        {/* <FadeInSection> */}
                        <div className ='top'>
                            <div className='folder-icon'>
                                <i class="far fa-folder"></i>
                            </div>
                            {/* <div className='year'>
                                {d.year}
                            </div> */}
                            <div className='link-icon'>
                                <a href={d.git}><i class="fab fa-github"></i></a>
                            </div>


                         </div>
                        <div className='item-title'>
                            {d.title}
                        </div>
                        <div className='item-desc'>
                            {d.desc}
                        </div>
                        <div className='item-tech'>
                            {/* <p>{d.skills}</p>
                            <p>{d.skills1}</p> */}
                           <div><p>{d.skills}</p></div>
                           <div><p>{d.skills1}</p></div>
                        </div>
                 </li>
                 </FadeInSection>
                ))}
                </ul>

            </div>
        </div>
    );
}
